/**
 * @param {number} n
 * @param {number} k
 * @return {number[]}
 */
var circularGameLosers = function(n, k) {
    let received = new Array(n).fill(false); // To track who received the ball
    let current = 0; // Starting at the first friend
    let turn = 1; // Starting with the first turn

    while (true) {
        // Calculate the next friend to pass the ball to
        current = (current + turn * k - 1) % n;
        if (received[current]) {
            break; // End the game if this friend has already received the ball
        }
        received[current] = true; // Mark the friend as having received the ball
        turn++; // Increment the turn
    }

    // Find friends who never received the ball
    let losers = [];
    for (let i = 0; i < n; i++) {
        if (!received[i]) {
            losers.push(i + 1); // Adjust for one-based indexing
        }
    }
    return losers;
};
